import React from 'react'
import styles from './ModalLogin.module.css';
import { googleLogin, githubLogin,naverLogin } from '../../api/firebase';

function ModalLogin({setModalOpen}) {
  const closeModal = () => {
    setModalOpen(false);
  };
  return (
    <div className={styles.modal}>
      <button className={styles.close} onClick={closeModal}>X</button>
      <div className={styles.loginSection}>
        <button className={`${styles.google} ${styles.l}`} onClick={()=>{googleLogin(); closeModal();}}>google</button>
        <button className={styles.github} onClick={()=>{githubLogin(); closeModal();}}>github</button>
        <button className={styles.naver} onClick={()=>{naverLogin(); closeModal();}}>github</button>
      </div>    
    </div>
  );
}

export default ModalLogin
